import { Link } from "react-router-dom";

function Drone() {
  return (
    <div
      style={{
        display: "grid",
        gridTemplateRows: "repeat(3, 1fr)", // change this to gridTemplateRows
        gridGap: "10px",
        margin: "0 auto",
        maxWidth: "800px",
      }}
    >
      <div
        style={{
          backgroundColor: "#ccc",
          height: "200px",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
